import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  const fs = require('fs');
  const csv = require('csv'); 

  fs.createReadStream('resources/6th_edition_skills.csv')
  .pipe(csv.parse(function(err, data) {

        console.log(data);

  }));

  return (
    <div className="App">
      <h2>キャラクターシート</h2>
    </div>
  );
}

export default App;
